import React from 'react';
import { Box, Typography, TextField, Button } from '@mui/material';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';

function ClientDashboard({ chat, sendMessage, setMessage, handleTyping, message, typingUser }) {
  return (
    <Box mt={3}>
      <Typography variant="h6">üìÖ ◊ú◊ï◊ó ◊©◊†◊î</Typography>
      <Calendar />

      <Box sx={{ mt: 3 }}>
        <Typography variant="h6">üí¨ ◊¶'◊ê◊ò</Typography>
        <TextField value={message} onChange={(e) => { setMessage(e.target.value); handleTyping(); }} label="◊î◊ß◊ú◊ì ◊î◊ï◊ì◊¢◊î" fullWidth />
        <Button onClick={sendMessage} variant="contained" sx={{ mt: 1 }}>◊©◊ú◊ó</Button>
        {typingUser && <Typography sx={{ color: "gray", mt: 1 }}>{typingUser} ◊û◊ß◊ú◊ô◊ì...</Typography>}
        <ul>
          {chat.map((msg, index) => (
            <li key={index}>{msg.user}: {msg.text}</li>
          ))}
        </ul>
      </Box>
    </Box>
  );
}

export default ClientDashboard;
